INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MLKN', 'STOCK', 'MillerKnoll, Inc.', 'NMS', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'MillerKnoll, Inc. is engaged in the research, design, manufacture, selling and distribution of seating products, furniture systems, other freestanding furniture elements, textiles, leather, felt, home furnishings and related services. Its segments include Americas Contract, International Contract & Specialty, and Global Retail. Americas Contract segment includes the operations associated with the design, manufacture and sale of furniture products directly or indirectly through an independent dealership network for office, healthcare, and educational environments throughout North and South America. International Contract & Specialty segment includes the operations associated with the design, manufacture and sale of furniture products, directly or indirectly through an independent dealership network in Europe, the Middle East, Africa and Asia-Pacific. Global Retail segment includes operations associated with the sale of modern design furnishings and accessories to third party retailers.', 'Zeeland, MI, United States', 10382);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTCK', 'STOCK', 'Davis Commodities Limited', 'NCM', 'Consumer Defensive', 'Farm Products', 'Davis Commodities Limited is an agricultural commodity trading company. It is engaged in the trading of three main categories of agricultural commodities, namely sugar, rice, and oil and fat products. The Companys segments include the sale of sugar, sale of rice, sale of oil and fat products, and sale of others. It also provides customers with ancillary services, such as warehouse handling and storage and logistics services. It is engaged in using a global network of third-party commodity suppliers and logistics service providers to distribute sugar, rice, and oil and fat products to customers in approximately 20 countries. The Company markets the commodities it distributes under two main brands, namely Maxwill and Taffy. The Maxwill brand is used for the sugar products and oil and fat products that the Company distributes outside of Singapore. Its subsidiaries include Maxwill Pte. Ltd., Maxwill (Asia) Pte. Ltd., LP Grace Pte. Ltd., Maxwill Foodlink Pte. Ltd., among others.', 'Singapore, , Singapore', 21);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIO', 'STOCK', 'Bio-Rad Laboratories, Inc.', 'NYQ', 'Healthcare', 'Medical Devices', 'Bio-Rad Laboratories, Inc. is engaged in developing, manufacturing, and marketing a range of products for the life science research and clinical diagnostics markets. The Company offers a range of products and systems used to separate complex chemical and biological materials and to identify, analyze and purify their components. It operates through two segments: Life Science and Clinical Diagnostics. The Life Science segment develops, manufactures, and markets instruments, systems, reagents, and consumables used for biological research, biopharmaceutical production processes, food testing regimes, and science education. Its Clinical Diagnostics segment designs, manufactures, markets and supports test systems, informatics systems, test kits and specialized quality controls that serve clinical laboratories in the global diagnostics market. These products are sold to hospital laboratories, diagnostic reference laboratories, transfusion laboratories, and physician office laboratories.', 'Hercules, CA, United States', 7700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('QUIK', 'STOCK', 'QuickLogic Corporation', 'NCM', 'Technology', 'Semiconductors', 'QuickLogic Corporation is a semiconductor company that develops embedded FPGA (eFPGA) intellectual property (IP), discrete FPGAs, and FPGA system-on-chips (SoCs) for a variety of industrial, aerospace and defense, edge, and endpoint artificial intelligence (AI), consumer, and computing applications. Its products include eFPGA IP Licensing business and associated professional services, consisting of the development and integration of eFPGA technology into custom semiconductor solutions. Its silicon products consist of EOS, QuickAI, ArcticLink III, PolarPro3, PolarPro II, PolarPro, and others. Its new products category includes its artificial intelligence/machine learning (AI/ML) Software Platform from its subsidiary company, SensiML, which includes Software-as-a-Service (SaaS) subscriptions for development when deployed in production, and proof-of-concept services. Its mature products include FPGA families named PASIC3 and QuickRAM, as well as programming hardware and design software.', 'San Jose, CA, United States', 59);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTS', 'STOCK', 'CTS Corporation', 'NYQ', 'Technology', 'Electronic Components', 'CTS Corporation is a global manufacturer of sensors, connectivity components, and actuators. The Company designs, manufactures, and sells a broad line of sensors, connectivity components, and actuators primarily to original equipment manufacturers (OEMs), suppliers for the aerospace and defense, industrial, medical, and transportation markets, and the United States Government. The Companys devices are categorized by their ability to Sense, Connect or Move. Sense products provide vital inputs to electronic systems. Connect products allow systems to function in synchronization with other systems. Move products ensure the required movements are effectively and accurately executed. Its Sense products include Controls, Pedals, Piezo Sensing Products, Sensors, Switches and Transducers. Its Connect products include EMI/RFI Filters, Capacitors, Frequency Control Products, Resistors and RF filters. The Companys Move products include Piezo Microactuators and Rotary Actuators.', 'Lisle, IL, United States', 3549);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EG', 'STOCK', 'Everest Group, Ltd.', 'NYQ', 'Financial Services', 'Insurance - Reinsurance', 'Everest Group, Ltd. É um underwriter baseado em Bermudas. A Empresa fornece soluções de seguros e resseguros de propriedade, acidentes e especialidades. Atua através de dois segmentos operacionais: Resseguro e Seguros. A operação de resseguro escreve resseguro de propriedade e de responsabilidade civil e linhas de negócios especializadas, tanto em base de tratado como facultativo, através de corretores de resseguros, bem como diretamente com empresas cedentes. Os negócios são escritos nos escritórios dos Estados Unidos (EUA), Bermudas e Irlanda, bem como através de filiais no Canadá, Cingapura, Reino Unido (Reino Unido) e Suíça. A operação de seguro escreve seguro de propriedade e acidentes diretamente e através de corretores, incluindo para linhas excedentes, e agentes gerais dentro dos EUA, Bermudas, Canadá, Europa, Cingapura, e América do Sul através de seus escritórios nos EUA, Austrália, Canadá, Chile, Colômbia, México, Cingapura, Reino Unido, Irlanda e filiais localizadas no Rein', 'Hamilton, , Bermuda', 3037);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRWL', 'STOCK', 'GraniteShares 2x Long CRWD Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2x (200%) the daily percentage change of the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHE', 'STOCK', 'Benchmark Electronics, Inc.', 'NYQ', 'Technology', 'Electronic Components', 'Benchmark Electronics, Inc. provides comprehensive solutions across the entire product life cycle through its technology and engineering design services, leveraging its global supply chain and delivering manufacturing services in various industries. It provides design engineering and advanced manufacturing services that include both electronic manufacturing services (EMS) and precision technology (PT) services. Its advanced manufacturing services include printed circuit board assembly (PCBA) and test, component engineering services, systems assembly and test development, and failure analysis. In addition to traditional EMS, it offers complex PT services, including full electromechanical assembly and test services. It offers a full spectrum of new product design, automation, test development, prototype and related engineering services. It provides its customers with a comprehensive range of custom circuit and functional test equipment, process automation and replication solutions.', 'Tempe, AZ, United States', 11700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATGE', 'STOCK', 'Adtalem Global Education Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'Adtalem Global Education Inc. is a provider of healthcare education in the United States, preparing a diverse workforce with academic programs. Its healthcare programs include nursing, medicine, veterinary medicine, social and behavioral sciences and more. Its segments include Chamberlain, Walden, and Medical and Veterinary. Chamberlain segment offers degree and certificate programs in the nursing and health professions postsecondary education industry. Walden segment offers degree and certificate programs, including those in nursing, education, counseling, business, psychology, public health, social work and human services, public administration and public policy, and criminal justice. Medical and Veterinary segment offers degree and certificate programs in the medical and veterinary postsecondary education industry. This segment includes American University of the Caribbean School of Medicine, Ross University School of Medicine, and Ross University School of Veterinary Medicine.', 'Chicago, IL, United States', 4703);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFYA', 'STOCK', 'Afya Limited', 'NMS', 'Consumer Defensive', 'Education & Training Services', 'A Afya Ltd é uma empresa sediada no Brasil envolvida no setor de educação. A empresa está focada principalmente na operação de escolas médicas, oferecendo cursos de ciências da saúde, que compreendem medicina, odontologia, enfermagem, radiologia, psicologia, farmácia, educação física, fisioterapia, nutrição e biomedicina. Além disso, o escritório oferece programas de graduação e cursos em outras disciplinas e disciplinas, incluindo cursos de graduação e pós-graduação em administração de empresas, contabilidade, direito, engenharia civil, engenharia industrial e pedagogia. A abordagem metodológica da empresa combina conteúdo integrado, aprendizagem interativa e uma experiência adaptativa para os alunos. Através de seu conteúdo educacional e atividades tecnológicas, a empresa se concentra em uma aprendizagem personalizada que espelha a tutoria individual. Os campi de graduação e pós-graduação da Companhia estão espalhados pelo Brasil, bem como sua plataforma médica digital.', 'Nova Lima, MG, Brazil', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUE', 'STOCK', 'Cue Biopharma, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cue Biopharma, Inc. is a clinical-stage biopharmaceutical company, developing a novel class of injectable biologics to selectively engage and modulate disease-specific T cells directly within the patients body. Its proprietary platform, Immuno-STAT (Selective Targeting and Alteration of T cells) and biologics are designed to harness the curative potential of the bodys intrinsic immune system through the selective modulation of disease-specific T cells without the adverse effects of broad systemic immune modulation. Its lead programs include drug product candidates designed to: CUE-400 series (Autoimmune Diseases) enhance regulatory T cells (Tregs) with a novel mechanism to proliferate, generate Tregs, and restore immune balance (CUE-401 for autoimmune conditions);CUE-500 series (Targeted Cell Depletion) redirect antiviral T cells to target eliminate pathogenic cells (CUE-501 for autoimmune B cell depletion); and CUE-100 series (Oncology) selectively activate tumor-specific T cells.', 'Boston, MA, United States', 41);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APM', 'STOCK', 'Aptorum Group Limited', 'NCM', 'Healthcare', 'Biotechnology', 'Aptorum Group Limited is a United Kingdom-based clinical-stage biopharmaceutical company dedicated to the discovery, development and commercialization of therapeutic assets to treat diseases with unmet medical needs, particularly in oncology (including orphan oncology indications) and infectious diseases. Its lead projects are ALS-4, SACT-1 and PathsDx Test. ALS-4 is a small drug molecule which appears to target the products produced by bacterial genes that facilitate the successful colonization and survival of the bacterium in the body or that cause damage to the body''s systems. SACT-1 is the first repurposed drug candidate to be developed under the Smart-ACT drug discovery platform. The Company''s pipeline is also enriched through the co-development of PathsDx Test, a molecular-based rapid pathogen identification and detection diagnostics technology, with Accelerate Technologies Pte Ltd, the commercialization arm of the Singapore''s Agency for Science, Technology and Research.', 'London, , United Kingdom', 1);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FDP', 'STOCK', 'Fresh Del Monte Produce Inc.', 'NYQ', 'Consumer Defensive', 'Farm Products', 'Fresh Del Monte Produce Inc. is a vertically integrated producer, marketer and distributor of fresh and fresh-cut fruit and vegetables as well as a producer and distributor of prepared food in Europe, Africa and the Middle East. It markets its products under the DEL MONTE brand, MANN brand and other related trademarks. Its segment includes fresh and value-added products, banana, and other products and services. Fresh and value-added products segment includes pineapples; fresh-cut fruit; fresh-cut vegetables, which include fresh-cut salads; melons; vegetables; non-tropical fruit, which includes grapes, apples, citrus, blueberries, strawberries, pears, peaches, plums, nectarines, cherries and kiwis; other fruit and vegetables, avocados, and prepared foods, including prepared fruit and vegetables, juices, other beverages, and meals and snacks. Other products and services segment includes its third-party freight and logistic services business and its Jordanian poultry and meats business.', 'George Town, , Cayman Islands', 33798);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECPG', 'STOCK', 'Encore Capital Group, Inc.', 'NMS', 'Financial Services', 'Credit Services', 'Encore Capital Group, Inc. is an international specialty finance company. The Company provides debt recovery solutions and other related services for consumers across a range of financial assets. Through its subsidiaries, the Company purchases portfolios of consumer receivables from banks, credit unions, and utility providers. It primarily purchases portfolios of defaulted consumer receivables at deep discounts to face value and manages them by working with individuals as they repay their obligations and work toward financial recovery. It also provides debt servicing and other portfolio management services to credit originators for non-performing loans in Europe. The Companys debt servicing operations include early-stage collections, business process outsourcing and contingent collections for credit originators. The Company mainly provides debt servicing for consumer accounts but also provides services for business-to-business accounts.', 'San Diego, CA, United States', 7350);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHY', 'STOCK', 'Calamos Convertible and High Income Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Convertible and High Income Fund is a closed ended fixed income mutual fund launched by Calamos Investments LLC. It is managed by Calamos Advisors LLC. The fund invests in the fixed income markets of the United States. It primarily invests in a diversified portfolio of convertible securities and high yield corporate bonds rated Ba or lower by Moody''s or BB or lower by Standard & Poor''s. The fund employs both fundamental and quantitative analysis to create its portfolio. Calamos Convertible and High Income Fund was formed on March 12, 2003 and is domiciled in the United States.', 'Naperville, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCG', 'STOCK', 'Cheche Group Inc.', 'NCM', 'Communication Services', 'Internet Content & Information', 'Cheche Group Inc is a holding company principally engaged in the operation of auto insurance technology platforms. The Company conducts its business primarily through its subsidiaries. The Company is committed to providing a technology-empowered platform for auto insurance transaction services. The Company is primarily engaged in the provision of digital insurance transactions and insurance software-as-a-service (SaaS) solutions to insurance carriers, insurance intermediaries, third-party platforms, referral partners and consumers. The Company''s digital insurance transaction products mainly include Easy-Insur, Insurance Marketplace, as well as insurance SaaS solution products Digital Surge and Sky Frontier. The Company principally conducts its businesses in the domestic market.', 'Beijing, , China', 548);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATHA', 'STOCK', 'Athira Pharma, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Athira Pharma, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing small molecules to restore neuronal health and slow neurodegeneration. Its approach is designed to modulate the neurotrophic hepatocyte growth factor (HGF) system, which is critical to normal brain function. The Companys lead drug candidate is ATH-1105. ATH-1105 is a novel, orally available, brain-penetrant small-molecule drug candidate designed to positively modulate the neurotrophic HGF system for the potential treatment of neurodegenerative diseases, including amyotrophic lateral sclerosis (ALS), Alzheimers disease (AD), and Parkinsons disease (PD). ATH-1105 is in development for the potential treatment of ALS. Its ATH-1020 is a novel, orally available small molecule drug candidate designed to positively modulate the neurotrophic HGF system. It has evaluated several other compounds in preclinical discovery and development for neurodegenerative diseases and other indications.', 'Bothell, WA, United States', 26);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCAX', 'STOCK', 'Bicara Therapeutics Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Bicara Therapeutics Inc. is a clinical-stage biopharmaceutical company committed to bringing transformative bifunctional therapies to patients with solid tumors. Its lead program, ficerafusp alfa, is a bifunctional antibody that combines two clinically validated targets, an epidermal growth factor receptor (EGFR), directed monoclonal antibody with a domain that binds to human transforming growth factor beta (TGF-b). Through this dual-targeting mechanism, ficerafusp alfa has the potential to exert potent anti-tumor activity by simultaneously blocking both cancer cell-intrinsic EGFR survival and proliferation and the immunosuppressive TGF-b signaling within the tumor microenvironment. Ficerafusp alfa is initially being developed in head and neck squamous cell carcinoma, where there remains a significant unmet need. Its platform is designed to facilitate the development of bifunctional therapies that precisely target the tumor and deliver a tumor-modulating payload to the tumor site.', 'Boston, MA, United States', 55);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPA', 'STOCK', 'Copa Holdings, S.A.', 'NYQ', 'Industrials', 'Airlines', 'Copa Holdings, S.A. is a provider of airline passenger and cargo service through its principal operating subsidiaries, Compania Panamena de Aviacion, S. A. (Copa Airlines) and AeroRepublica, S. A. (Copa Colombia). The Company operates through air transportation segment. Copa Airlines operates from its position located in the Republic of Panama. Copa Airlines provides international air transportation for passengers, cargo and mail, operating from its Panama City hub in the Republic of Panama. Copa Colombia provides service within Colombia and international flights from various cities in Colombia to Panama, Venezuela, Ecuador, Mexico, Cuba, Guatemala and Costa Rica. Copa Colombia provides domestic and international air transportation for passengers, cargo and mail with a point-to-point route network. Its subsidiary, Oval Financial Leasing, Ltd., controls the special purpose entities that have a beneficial interest in the majority of its fleet.', 'Panama City, , Panama', 7909);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFSC', 'STOCK', 'Enterprise Financial Services Corp', 'NMS', 'Financial Services', 'Banks - Regional', 'Enterprise Financial Services Corp is a financial holding company for Enterprise Bank & Trust (the Bank), which is a full-service financial institution, which offers banking and wealth management services to individuals and corporate customers primarily located in Arizona, California, Florida, Kansas, Missouri, Nevada, and New Mexico. The Bank offers a range of business and personal banking services and wealth management services. Its lending services include commercial and industrial, commercial real estate, real estate construction and development, residential real estate, specialty, small business administration, consumer and other loan products. The Company''s lending services include a variety of deposit products, including property management and community associations, along with a complete suite of treasury management and international trade services.', 'Clayton, MO, United States', 1218);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HCKT', 'STOCK', 'The Hackett Group, Inc.', 'NMS', 'Technology', 'Information Technology Services', 'The Hackett Group, Inc. is an IP and platform-based, Gen artificial intelligence (A.I.) strategic consulting and executive advisory company. The Companys segments include Global Strategy & Business Transformation (Global S&BT), Oracle Solutions, and SAP Solutions. The Global S&BT segment includes the Companys Gen A.I. and strategic business consulting practices. The Oracle Solutions Segment includes the Companys Oracle Enterprise Performance Management (EPM)/ Enterprise Resource Planning (ERP) and Digital Application Maintenance and Support (AMS) practices. SAP Solutions segment includes the Companys SAP applications and related SAP service offerings. Its software platform includes AI XPLR and ZBrain.ai. Its AI assessment platform allows measuring and assessing the impact of Gen A.I. technologies. It provides expertise in Gen A.I. strategy, operations, finance, strategic sourcing, and information technology, including its Oracle, SAP, OneStream, and Coupa implementation offerings.', 'Miami, FL, United States', 1478);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FAX', 'STOCK', 'Abrdn Asia-Pacific Income Fund Inc', 'ASE', 'Financial Services', 'Asset Management', 'abrdn Asia-Pacific Income Fund, Inc. (the Fund) is a closed-end, non-diversified investment management company. The Fund''s principal investment objective is to seek current income. The Fund aims to provide monthly income by investing primarily in locally researched Asian and Australian debt securities. The Fund invests approximately 80% of its assets, plus the amount of any borrowings for investment purposes in Asia-Pacific debt securities, which includes debt securities of Asia-Pacific Country issuers, including securities issued by Asia-Pacific Country governmental entities, as well as by banks, companies and other entities which are located in Asia-Pacific Countries, and debt securities issued by a wholly owned subsidiary of an entity located in an Asia-Pacific Country, provided that the debt securities are guaranteed by the parent entity located in the Asia-Pacific Country. The Fund''s investment manager is abrdn Asia Limited.', 'Singapore, , Singapore', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENTO', 'STOCK', 'Entero Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Entero Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is engaged in the research and development of targeted, non-systemic therapies for the treatment of patients with gastrointestinal (GI) diseases. The Company is focused on developing the biologic Adrulipase, a recombinant lipase enzyme designed to enable the digestion of fats and other nutrients in cystic fibrosis (CF) and chronic pancreatitis (CP) patients with exocrine pancreatic insufficiency (EPI). Adrulipase is the active pharmaceutical ingredient (API) derived from Yarrowia lipolytica, an aerobic yeast naturally found in various foods such as cheese and olive oil that is widely used as a biocatalyst in several industrial processes. The Company is developing Adrulipase for two principal therapeutic indications: children and adults affected by CF, and adult patients with CP.', 'Boca Raton, FL, United States', 2);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCRN', 'STOCK', 'Cross Country Healthcare, Inc.', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Cross Country Healthcare, Inc. is a technology-enabled workforce solution and advisory company. The Companys segments include Nurse and Allied Staffing and Physician Staffing. The Nurse and Allied Staffing segment provides traditional staffing, recruiting, and value-added total talent solutions, including temporary and permanent placement of travel and local nurse and allied professionals, and healthcare leaders within nursing, allied, physician, and human resources; vendor neutral programs and managed service programs; education healthcare services; in-home care services, and outsourcing services. The Physician Staffing segment provides physicians in many specialties, as well as certified registered nurse anesthetists, nurse practitioners, and physician assistants as independent contractors on temporary assignments throughout the United States at various healthcare facilities, such as acute and non-acute care facilities, government facilities and managed care organizations.', 'Boca Raton, FL, United States', 9605);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZZ', 'STOCK', 'AZZ Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'AZZ Inc. is a provider of hot-dip galvanizing and coil coating solutions to a range of end-markets in North America. The Company operates through three segments. Its AZZ Metal Coatings segment provides metal coating solutions for corrosion protection, including hot-dip galvanizing, spin galvanizing, powder coating, anodizing and plating to the North American steel fabrication industry and other industries. AZZ Precoat Metals segment provides aesthetic and corrosion protective coatings and related value-added services for steel and aluminum coils, primarily serving the construction, transportation and other end markets in North America. The AZZ Infrastructure Solutions segment holds a non-controlling interest in AIS Investment Holdings LLC, which is primarily dedicated to delivering safe and reliable transmission of power from generation sources to end customers, and automated weld overlay solutions for corrosion and erosion mitigation to critical infrastructure in markets worldwide.', 'Fort Worth, TX, United States', 3684);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVNS', 'STOCK', 'Avanos Medical, Inc.', 'NYQ', 'Healthcare', 'Medical Devices', 'Avanos Medical, Inc. is a medical technology company focused on delivering medical device solutions. It offers healthcare needs, such as providing nutrition to patients from hospital to home and reducing the use of opioids while helping patients move from surgery to recovery. Its segment includes Specialty Nutrition Systems and Pain Management and Recovery. Specialty Nutrition Systems portfolio of products includes enteral feeding, which includes products such as MIC-KEY enteral feeding tubes and Corpak patient feeding solutions and Neonate solutions feeding products consist of NeoMed neonatal and pediatric feeding solutions. Pain Management and Recovery portfolio of products includes surgical pain and recovery products such as ON-Q and ambIT surgical pain pumps and Game Ready cold and compression therapy systems and Radiofrequency Ablation solutions, which provide invasive pain relief therapies, such as COOLIEF, Trident and ESSENTEC RFA products used to treat chronic pain conditions.', 'Alpharetta, GA, United States', 2227);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCOM', 'STOCK', 'Dime Community Bancshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Dime Community Bancshares, Inc. is a bank holding company. The Company is engaged in providing commercial banking and financial services through its wholly owned subsidiary, Dime Community Bank (the Bank). The Bank is engaged in providing full-service commercial and consumer banking services, including accepting time, savings and demand deposits from businesses, consumers, and local municipalities. It also offers the Certificate of Deposit Account Registry Service (CDARS) and Insured Cash Sweep (ICS) programs. In addition, it offers merchant credit and debit card processing, automated teller machines, cash management services, lockbox processing, online banking services, remote deposit capture, safe deposit boxes, and individual retirement accounts, as well as investment services through Dime Financial Services LLC. Through its title insurance subsidiary, the Bank acts as a broker for title insurance services.', 'Hauppauge, NY, United States', 887);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSP', 'STOCK', 'Viant Technology Inc.', 'NMS', 'Technology', 'Software - Application', 'Viant Technology Inc. is an advertising technology company. The Company is engaged in artificial intelligence (AI)-powered programmatic advertising. The Companys omnichannel platform, built for Connected TV (CTV), allows marketers to plan, execute, and measure their campaigns. Its cloud-based demand side platform (DSP) enables the programmatic purchase of advertising, which is the electronification of the digital advertising buying process. Its DSP is used by marketers and their advertising agencies to centralize the planning, buying and measurement of their digital advertising across various channels. Through its omnichannel platform, a marketer can buy ads on CTV, mobile, desktop, in-game, streaming audio and digital billboards. Its product suite, ViantAI, handles every stage of programmatic advertising, from building campaigns to optimizing execution. IRIS.TV, a Viant Technology company, is the only data platform built for video and CTV. IRIS_ID is its content identifier.', 'Irvine, CA, United States', 376);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BELFB', 'STOCK', 'Bel Fuse Inc.', 'NMS', 'Technology', 'Electronic Components', 'Bel Fuse Inc. designs, manufactures and markets a range of products that power, protect and connect electronic circuits. Its segments include Power Solutions and Protection, Connectivity Solutions and Magnetic Solutions. Power Solutions and Protection Segment includes internal and external AC/DC power supplies, DC/DC converters and DC/AC inverters utilized in defense, commercial aerospace, industrial, networking and consumer applications. Connectivity Solutions Segment includes high speed and harsh environment copper and optical fiber connectors and integrated assemblies, providing connectivity solutions within the commercial aerospace, military communications, defense, network infrastructure, structured building cabling and several industrial applications. Its magnetics solutions product line includes integrated connector modules (ICMs), power transformers, surface mount device (SMD) power inductors and switch mode power supply (SMPS) transformers, and discrete components-ethernet.', 'West Orange, NJ, United States', 5370);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLB', 'STOCK', 'Dolby Laboratories, Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'Dolby Laboratories, Inc. is engaged in designing and manufacturing of audio and imaging hardware and software products for the cinema, television, broadcast and entertainment industries. The two primary components of its licensing business are Branded Technologies, which include Branded Audio Codecs, Dolby Atmos & Dolby Vision, and Patents, which include Audio Patents and Imaging Patents. The Company''s cinema imaging products include digital cinema servers used to load, store, decrypt, decode, watermark, and playback digital film files for presentation on digital cinema projectors and software used to encrypt, encode and package digital media files for distribution. Its cinema audio products include cinema processors, amplifiers and loudspeakers used to decode, render, and optimally play back digital cinema soundtracks, including those using Dolby Atmos. It also offers various services to support theatrical and television production for cinema, broadcast, and home entertainment.', 'San Francisco, CA, United States', 2080);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRESY', 'STOCK', 'Cresud Sociedad Anónima, Comercial, Inmobiliaria, Financiera y Agropecuaria', 'NMS', 'Industrials', 'Conglomerates', 'Cresud SACIF y A is an Argentina-based company engaged mainly in the agricultural sector engaged in the production of basic agricultural commodities with a growing presence in the agricultural sector of Argentina and Brazil as well as in other Latin American countries. The Business segments focus on acquiring, developing and exploiting agricultural properties accommodating farming activities, cattle raising, including a meat packing plant as well as grains and sugarcane production. The Company''s acquisition, development and exploitation of agricultural properties allow for selective sale and leasing land to third parties that perform agency and agro-industrial services. Also known as Cresud Inc. is also directly and indirectly engaged in the real estate business through IRSA and its subsidiaries and joint ventures, including development, acquisition and operation of shopping malls, offices, and luxury hotels in Argentina.', 'Buenos Aires, , Argentina', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELVN', 'STOCK', 'Enliven Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Enliven Therapeutics, Inc. is a clinical-stage biopharmaceutical company focused on the discovery and development of small molecule inhibitors to help patients with cancer. It is advancing two parallel lead product candidates, ELVN-001 and ELVN-002, and pursuing several additional research stage opportunities that align with its development approach. Its first product candidate, ELVN-001, is a potent, highly selective, small molecule kinase inhibitor designed to specifically target the breakpoint cluster region-Abelson (BCR-ABL) gene fusion, the oncogenic driver for patients with chronic myeloid leukemia. Its second product candidate, ELVN-002, is a potent, highly selective, central nervous system penetrant and irreversible human epidermal growth factor receptor 2 (HER2) inhibitor with activity against wild type HER2 and various HER2 mutations. ELVN-002 is designed to inhibit wild type HER2 and key mutations of HER2, while sparing wild-type EGFR and avoiding EGFR-related toxicities.', 'Boulder, CO, United States', 65);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BVS', 'STOCK', 'Bioventus Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'Bioventus Inc. is a medical device company. The Companys portfolio of products is grouped into three areas. Its Pain Treatments include the Knee Osteoarthritis (KOA) area, and Peripheral Nerve Stimulation (PNS) area. Its Surgical Solutions include Ultrasonics, which offers precision bone resection for patients with degenerative spine conditions and spinal deformities, and Bone Graft Substitutes (BGS), which includes a range of products that facilitate optimal bone fusion following a surgical procedure. Its Restorative Therapies comprise Fracture Care that provide low-intensity pulse ultrasound to help patients who suffer from bone fractures that do not heal through traditional methods. It offers a diverse portfolio of products to support physicians in relieving pain and addressing musculoskeletal challenges across indications and clinical areas, including knee, hand and upper extremities, foot and ankle, podiatry, trauma, general surgery, spine and neurosurgery.', 'Durham, NC, United States', 950);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHNR', 'STOCK', 'China Natural Resources, Inc.', 'NCM', 'Industrials', 'Pollution & Treatment Controls', 'China Natural Resources, Inc. is a holding company. The Company holds mining rights that allows it to mine, process and sell non-ferrous metals extracted or produced at Yangchong Mine located in Anhui Province in the People''s Republic of China (PRC). The Company operates through exploration and mining-non-ferrous metals segment. The Company focuses to continue its acquisition and exploitation of mining rights, including the exploration, mineral extraction, processing and sales of iron, zinc and other nonferrous metals extracted or produced at mines mainly located in Anhui Province in the PRC, as well as its operation of related businesses. The Company conducts these activities through its indirect subsidiary, Wuhu Feishang Mining Development Co., Limited (Wuhu Feishang). The Company is in the early-stages of exploration for additional mineable ore at Yangchong Mine. Wuhu Feishang''s principal activity is the mining of zinc, iron and other minerals for distribution in the PRC.', 'Shenzhen, , China', 9);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOMH', 'STOCK', 'Dominari Holdings Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'Dominari Holdings Inc. is a holding company. The Company, through its various subsidiaries, is engaged in wealth management, investment banking, sales and trading and asset management. It operates through its wholly owned subsidiaries, including Dominari Financial Inc. (Dominari Financial) and Dominari Securities LLC (Dominari Securities). Dominari Securities offers a broad range of broker, dealer and registered investment adviser services. Dominari Securities investment banking division provides strategic advisory services and capital markets products to middle market businesses. Its investment banking services include financial advisory, equities capital markets, debt capital markets, fund placement, debt advisory & restructuring, and private equity. Dominari Securities offers discretionary and non-discretionary fee-based programs to provide tailored investment management solutions and services to high-net-worth private clients, institutions and corporations.', 'New York, NY, United States', 29);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDTG', 'STOCK', 'CDT Environmental Technology Investment Holdings Limited', 'NCM', 'Industrials', 'Waste Management', 'CDT Environmental Technology Investment Holdings Ltd is a holding company principally engaged in design, development, manufacture, sales, installation, operation and maintenance of sewage treatment systems and provision of sewage treatment services. The Company operates its businesses through two segments. The Sewage Treatment Systems segment sells complete sewage treatment systems, constructs rural sewage treatment plants, installs the systems, and provides on-going operation and maintenance services for such systems and plants in China for municipalities and enterprise clients. The Sewage Treatment Services segment offers on site, or in-situ, septic tank treatment services in the urban and rural areas of China for municipalities and residential and business property management companies.', 'Shenzhen, , China', 73);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPAY', 'STOCK', 'Corpay, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'A Corpay, Inc. É uma empresa de pagamentos corporativos que ajuda empresas e consumidores a gerenciar e pagar despesas. O conjunto de soluções de pagamento da Companhia ajuda os clientes a gerenciar despesas relacionadas a veículos, como abastecimento e estacionamento, despesas de viagem, como reservas de hotéis e contas a pagar, como fornecedores pagantes. Seus segmentos incluem Pagamentos de Veículos, Pagamentos Corporativos, Pagamentos de Hospedagem e outros. Suas soluções incluem automação de AP, cartões transfronteiriços, compras e T&E e cartão virtual. Suas soluções de automação AP incluem automação de pagamentos, automação de faturas, automação de pedidos de compra e integrações. Sua solução de cartão virtual fornece um número de cartão de uso único para uma quantidade específica, utilizável dentro de um período de tempo definido. Sua plataforma de negociação e soluções de pagamento integradas, que podem ser personalizadas de acordo com as necessidades de negócios do cliente. Su', 'Atlanta, GA, United States', 11200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACT', 'STOCK', 'Enact Holdings, Inc.', 'NMS', 'Financial Services', 'Insurance - Specialty', 'Enact Holdings, Inc. operates principally through its wholly owned subsidiary, Enact Mortgage Insurance Corporation, a private mortgage insurance provider. The Company is engaged in the business of writing and assuming residential mortgage guaranty insurance. The insurance protects lenders and investors against certain losses resulting from nonpayment of loans secured by mortgages, deeds of trust, or other instruments constituting a lien on residential real estate. It facilitates the sale of mortgages to the secondary market, including to private investors, as well as the Federal National Mortgage Association (Fannie Mae) and the Federal Home Loan Mortgage Corporation (Freddie Mac). It has a diverse customer base and maintains enduring relationships across the mortgage origination market, including with national banks, non-bank mortgage lenders, local mortgage bankers, community banks and credit unions. Fannie Mae and Freddie Mac are government-sponsored enterprises.', 'Raleigh, NC, United States', 421);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHAT', 'STOCK', 'Blue Hat Interactive Entertainment Technology', 'NCM', 'Communication Services', 'Electronic Gaming & Multimedia', 'Blue Hat Interactive Entertainment Technology is a producer, developer and operator of augmented reality (AR) interactive entertainment games and toys in China, including interactive educational materials, mobile games, and toys with mobile game features. The Company mainly engaged in interactive toys, including animation and game series, mobile games and animation design services.', 'Xiamen, , China', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAKT', 'STOCK', 'Daktronics, Inc.', 'NMS', 'Technology', 'Electronic Components', 'Daktronics, Inc. is a global designer and manufacturer of dynamic video communication displays and control systems for customers worldwide. Its segments include Commercial, Live Events, High School Park and Recreation, Transportation, and International. Commercial segment consists of sales of its integrated video display systems, digital billboards, Galaxy and Fuelight product lines, and dynamic messaging systems. Live Events segment consists of sales of integrated scoring and video display systems, and sales of its mobile display technology to video rental organizations and other live events type venues. High School Park and Recreation segment consists of sales of scoring systems, Galaxy displays and video display systems to primary and secondary education facilities and resellers. Transportation segment primarily consists of sales of intelligent transportation systems dynamic messaging signs for road management, mass transit, and aviation applications and other electronic signage.', 'Brookings, SD, United States', 2422);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDN', 'STOCK', 'Empresa Distribuidora y Comercializadora Norte Sociedad Anónima', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Empresa Distribuidora y Comercializadora Norte S.A. is a public service company. The Company is engaged in electricity distribution in Argentina. It holds a concession to distribute electricity to the northwestern part of the greater Buenos Aires metropolitan area and in the northern part of the City of Buenos Aires. The Company''s concession area of approximately 4,637 square kilometers is divided into three operating territories: Region I, which consists of over 251 square kilometers; Region II, which consists of approximately 1,761 square kilometers, and Region III, which consists of over 2,625 square kilometers. Region I includes Ciudad de Buenos Aires, San Isidro, Vicente Lopez, San Martin and Tres de Febrero districts. Region II includes La Matanza, Moron, Hurlingham, Ituzaingo, Merlo, Marcos Paz and Gral. Las Heras districts. Region III includes Pilar, Escobar, Tigre, San Fernando, San Miguel, Malvinas Argentinas, Jose C. Paz, Moreno and Gral. Rodriguez districts.', 'Buenos Aires, , Argentina', 4642);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIT', 'STOCK', 'Applied Industrial Technologies, Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'Applied Industrial Technologies, Inc. is a value-added distributor and technical solutions provider of industrial motion, fluid power, flow control, automation technologies, and related maintenance supplies. The Companys segments include Service Center Based Distribution and Engineered Solutions. The Service Center Based Distribution segment operates through local service centers and distribution centers with a focus on providing products and services addressing the maintenance and repair of motion control infrastructure and production equipment. Its products include industrial bearings, motors, belting, drives, couplings, pumps, linear motion products, hydraulic and pneumatic components, filtration supplies, and hoses. The Engineered Solutions segment includes its operations that specialize in distributing, engineering, designing, integrating, and repairing hydraulic and pneumatic fluid power technologies, and engineered flow control products and services.', 'Cleveland, OH, United States', 6818);\n